import Navbar from "../components/Navbar"
import {withRouter} from "next/router"
const Post = (props) => (
  <>
  <Navbar/>
  <h1>Post page {props.router.query}</h1>
  </>
);
Post.getInitialProps = async ({query}) => {
  return query
};

export default withRouter(Post);
//query look at documents in next
